use twitter_clone;

drop table tweets; 

CREATE TABLE tweets (
    tweetId INT AUTO_INCREMENT PRIMARY KEY,
    user_id INT NOT NULL,
    tweet_body VARCHAR(2000) NOT NULL,
    likes INT,
    retweets INT,
    comments INT,
    views INT,
    CONSTRAINT `fk_user_id` FOREIGN KEY (user_id)
        REFERENCES users (id)
        ON UPDATE CASCADE ON DELETE CASCADE
);



